import { connect } from "react-redux";
import { withRouter } from "react-router-dom";

function Playvideo(props) {
  return (
    <div className="play-video-page-component">
      {props.id}
    </div>
  );
}
Playvideo = withRouter(Playvideo);
export default connect()(Playvideo);
